import React from 'react'
import {Link} from "react-router-dom";
import NavbarInfo from './NavbarInfo';

function NavLinks(props) {
	return (
		<div>
			<NavbarInfo to={props.navlinks.path}>
		{props.navlinks.name}{" "}
			</NavbarInfo>
		</div>
	)
}

export default NavLinks
